import './App.css';
import particles from "./constants/Particles";
import Particles from 'react-tsparticles'

function App() {
  return (
    <div className="App">
        <div className="custom-text">
          <h1>Talkdesk Chat</h1>
          <h3>Testing Website</h3>
        </div>

        <Particles
                      params={particles}

        />
    </div>
  );
}

export default App;
